import React from 'react'
import './EventBox.css';
import { Link } from 'react-router-dom';
const EventBox = ({img,title,description,location,_id}) => {
  return (
    <div className='eventBox'>
    <div className="top" style={{backgroundImage: img}}></div>
    <div className="bottom">
        <h3>{title}</h3>
        <p>{description}</p>
        {/* <p>{e.participants.length} participanting</p> */}
        <p><FaMapMarkerAlt/>Location: {location}</p>
        <Link to={`/event/${_id}`}>Check Out</Link>
    </div>
</div>
  )
}

export default EventBox
